    public function load(ObjectManager $om)
    {        
        foreach ($this->cityZones as $i => $data) {
            echo 'Loading the '.$data['name']." zone\n"
                ;
            $zone = new Zone();
            $zone->setId($i);
            $zone->setName($data['name']);
            $zone->setSlug($data['slug']);
            $zone->setCodeProvince(7000);
            $zone->setType(Zone::TYPE_CITY);
            $zone->setDescription($data['desc']);
            
            if(array_key_exists('poly', $data)) {
                $zone->setPolygon(new Polygon($data['poly']));
                $zone->setCenter((new Point($data['center'])));
            } else {
                $zone->setPolygon(new Polygon([
                    [
                        [$data['east'], $data['north']],[$data['west'], $data['north']],
                        [$data['west'], $data['south']],[$data['east'], $data['south']],
                        [$data['east'], $data['north']]
                    ]
                ]));
                $zone->setCenter(new Point(($data['east'] + $data['west'])/ 2,
                 ($data['north'] + $data['south'])/2));
            }
            
            if(array_key_exists('fill_color', $data)) {
                $zone->setFillColor($data['fill_color']);
            } else {
                $zone->setFillColor('rgba(240,240,0,0.3)');
            }
            
            $om->persist($zone);
            
            $this->addReference('zone_'.$zone->getSlug(), $zone);
        }
        $om->flush();
    }
